import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{o as r,c as n,a as o,b as e,d as a,e as s}from"./app-cfe0cb73.js";const d={},t=e("h1",{id:"个人简介",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#个人简介","aria-hidden":"true"},"#"),a(" 个人简介")],-1),h=e("h2",{id:"个人优势",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#个人优势","aria-hidden":"true"},"#"),a(" 个人优势")],-1),l=e("p",null,"熟练掌握Java、C#，熟悉python、go等语言，熟练掌握vue、jquery等前端框架。熟练掌握 spring、springboot以及主流微服务框架。喜欢阅读源码，熟悉 nacos、apollo、seata、nginx、redis等开源中间价原理。精通maven管理并会开发相关插件辅助开发。精通主流数据库sql调优，熟悉JVM调优。精通Jenkins，docker部署和linux操作。精通svn和git进行版本管理。具微服务和DevOps架构设计经验。具备爬虫开发及机器学习基础。",-1),c=s('<h2 id="工作经历" tabindex="-1"><a class="header-anchor" href="#工作经历" aria-hidden="true">#</a> 工作经历</h2><ol><li>担任整个业务条线架构师，参与多个产品的架构设计工作,其中包括SAAS化交易平台、竞价系统、App、商城系统等。对架构不合理的产品提出代码重构建议，并对核心代码进行代码审计。参与了重点产品微服务重构，引入领域驱动及组件化的理念。进行多个技术立项的研究，如基于文本相似度分析的标书比对技术、微服务组件openfeign适配公司不同业务场景研究、SOFAARK解决类冲突方案、office365自研方案替换、基于nacos和apollo的配置中心方案等。熟悉公司自研的开发框架，深入理解底层实现逻辑及技术栈。</li><li>负责整个业务条线效能提升工作，通过引入DevOps体系，将整个研发过程的标准化、各环节的工具链串联，通过CI/CD达到更快交付业务价值的目标。深入研究jenkins插件开发及基于groovy的拓展库开发实现不同业务需求。自学go及electron开发各种效能提升工具。</li><li>负责自营产品新运维体系的搭建，基于公司DevOps体系及docker容器管理平台（类似k8s的容器管理平台，比原生k8s新增了镜像构建的能力，为公司自主研发产品。虽未参与但通过日常使用清楚其实现原理及架构体系）实现跨网络跨机房的docker镜像自动化更新方案。</li><li>带领团队负责各产品交付客户所需服务器资源的整体评估工作，根据客户的使用规模给出不同的部署架构方案，并协助项目交付完成各产品的部署及配置工作。其中包括多个大型央企项目的部署架构设计，如：中石化、中海油、中国电信等。</li><li>曾担任业务条线技术专家，解决各项目疑难问题及性能调优。通过分析jvm、jstack、火焰图、数据库执行计划及慢sql等方式定位问题。并作为公司内聘讲师组织相关培训传授经验。</li><li>曾参与公司上市前财经体系的设计和开发工作，负责梳理各财经数据，通过数据挖掘形成相关指标，并运用公司自研的数据交换工具进行数据治理，通过编写算法实现计算复杂业务指标。</li><li>通过业余时间自学python开发，会开发爬虫爬取房价数据并进行分析。自学机器学习，了解朴素贝叶斯推荐算法及余弦相似度算法，会利用开源模型进行机器学习训练。自学小程序开发并拥有自己的微信公众号进行技术分享。</li></ol><h2 id="工作业绩" tabindex="-1"><a class="header-anchor" href="#工作业绩" aria-hidden="true">#</a> 工作业绩</h2><p>业务背景：业务条线产品较多，各产品部署及配置复杂，需人牵头统一对外服务。 业务目标：引入DevOps体系，通过CI/CD达到更快交付业务价值的目标。 具体工作内容：负责DevOps体系的架构设计，带领团队管理业务条线所有产品部署包，并对部署包质量负责，统一对项目提供交付服务。 最终获得成果：成果上线公司内部的DevOps体系，管理了上百个产品不同版本的部署包，每年对近500个项目提供共计上万个应用部署服务，大大提升了产品交付的效率及质量。</p><h2 id="拥有技能" tabindex="-1"><a class="header-anchor" href="#拥有技能" aria-hidden="true">#</a> 拥有技能</h2><ol><li>Java</li></ol><h2 id="项目经历" tabindex="-1"><a class="header-anchor" href="#项目经历" aria-hidden="true">#</a> 项目经历</h2><h3 id="公司devops体系搭建" tabindex="-1"><a class="header-anchor" href="#公司devops体系搭建" aria-hidden="true">#</a> 公司DevOps体系搭建</h3><blockquote><p>2021-10 ~ 2022-12 架构师</p></blockquote><hr><h4 id="工作内容" tabindex="-1"><a class="header-anchor" href="#工作内容" aria-hidden="true">#</a> <strong>工作内容</strong></h4><p>为实现产品线所有产品部署包的统一发布并管控，公司层面进行了内部立项，我作为产品经理对整个平台进行了需求规格说明书的编写，并参与了整个平台的架构设计。对比 gitlab的 CI/CD和 jenkins ，我们最终选择了 jenkins ，通过 Jenkins的 pipeline 方式，封装了一套集成开发平台对内部产品部署包的统一打包并发布及管控，并通过 Jenkins 的扩展库能力实现了对部署包的检验。 通过集成开发平台与公司 docker 容器管理平台的对接，实现了产品的持续集成持续部署能力</p><h4 id="工作业绩-1" tabindex="-1"><a class="header-anchor" href="#工作业绩-1" aria-hidden="true">#</a> <strong>工作业绩</strong></h4><p>对整个公司研发效能实现了很大的提升，开发人员只需要关注代码的提交，通过 devops 实现部署包的自动构建并发布，实现了产品的持续集成持续部署，让开发人员只需关注代码而需要关注其他事情，从而提高了代码的质量。</p>',14);function p(f,u){return r(),n("div",null,[t,h,l,o(" more "),c])}const k=i(d,[["render",p],["__file","intro.html.vue"]]);export{k as default};
